td.sdtext {
	color: #414141;
	font-size: 11px;
}
td.sdtext a:link {
	color: #414141;
}
td.sdtext a:link {
	color: #333;
}
td.sdtext a:hover {
	color: #069;
}
td.breadcrumbs_list {
	color: #414141;
}
a.breadcrumbs_list:link {
	color: #414141;
}
a.breadcrumbs_list:hover {
	color: #069;
}
#risFil .risfFootWrap {
	margin: 50px 0 0 0;
	clear: both;
}
#risFil table a {
	color: #333;
	padding: 10px 20px;
}
#risFil table a:hover {
	text-decoration: no;
}
#risFil tr td a.category_itemnamelink {
	width: 190px;
	height: 5.4em;
	font-size: 11px;
	line-height: 1.5em;
	display: block;
	text-align: left;
	overflow: hidden;
}
:root #risFil tr td a.category_itemnamelink {
	height: 3.5em;
}
span.category_itemprice, span.category_itemtaxpostage {
	font-size: 12px;
	font-weight: bold;
	line-height: 1.5em;
	color: #C00;
	padding: 10px 0 0 0;
}
#risFil table tbody tr td br {
	display: none;
}
#risFil table tbody tr td {
	background: url() left bottom no-repeat;
}
#risFil table tbody tr td:first-child {
	background: none;
}
#risFil table tbody tr td a img {
	margin: 50px 0 0 0;
}
#risFil table tbody tr td span.category_itemprice {
	font-size: 12px;
}
#risFil table tbody tr td span.not {
	font-size: 12px;
}
#risFil table tbody tr td span.category_itemtaxpostage {
	font-size: 12px;
}
#risFil table tbody tr td div.risfClfx {
	font-size: 12px;
}

#rnkInShopMain {
	overflow: hidden;
	height: 300px;
}
iframe#head_navi {
	width: 960px;
	height: 40px;
	margin: 0;
	padding: 0;
	position: relative;
	z-index: 2;
}
iframe#header_frame {
	margin: 0;
	height: 500px;
	position: relative;
	z-index: 1;
}

.syo-tokucho{
color:#333333;
font-size:15px;
font-weight:bold;
letter-spacing:0.1em;
line-height:120%;
}
.syo-setsu{
color:#666666;
font-size:13px;
line-height:120%;
}

